Chart.defaults.global.defaultFontFamily='-apple-system,system-ui,BlinkMacSystemFont,"Segoe UI",Roboto,"Helvetica Neue",Arial,sans-serif';Chart.defaults.global.defaultFontColor="#292b2c";$("#myBarChart").ready(function(){$.get("/Dashboard/BarData",function(n){var t=new Chart(document.getElementById("myBarChart"),{type:"bar",data:{labels:n.labels,datasets:[{label:"Revenue",backgroundColor:"rgba(2,117,216,1)",borderColor:"rgba(2,117,216,1)",data:n.data}]},options:{scales:{xAxes:[{time:{unit:"month"},gridLines:{display:!1},ticks:{maxTicksLimit:n.data.length}}],yAxes:[{ticks:{min:0,max:Math.max.apply(Math,n.data),maxTicksLimit:n.data.length},gridLines:{display:!0}}]},legend:{display:!1}}})})});